onChange.script:
pyBase = system.util.jsonDecode(self.view.params.jsonBase)
pyOut = system.util.jsonDecode(self.view.params.jsonOut) 

if not(isinstance(pyOut, dict)):
	pyOut = {}

# Add to jsonOut to node 'wherePlus' condition 'cnd' which is specified in jsonBase
# 'cnd' is condition with full column name: "[schema].[table].[column] = ?"
# or if nothing is selected - special case "always True" like -1 = ? (and arg is -1). 
# For example: "cnd":"[lodging].[Room].[id] = ?"
# example for jsonOut: {"wherePlus":[{"arg":7,"cnd":"[lodging].[Room].[id] = ?"}]}
# example for jsonOut: {"wherePlus":[{"arg": -1,"cnd":"-1 = ?"}]}

if currentValue.value > 0:
    pyOut["wherePlus"] = [ {'arg': currentValue.value, 'cnd': pyBase['cnd']} ]
else:
	pyOut["wherePlus"] = [ {'arg': currentValue.value, 'cnd': '{} = ?'.format(currentValue.value)}]

self.view.params.jsonOut = system.util.jsonEncode(pyOut)

#system.perspective.print(('Dropdown  onvaluechanged jsonOut', self.view.params.jsonOut ))

customMethods.script:
jsonBase = self.view.params.jsonBase
jsonIn = self.view.params.jsonIn

#system.perspective.print(('setByJsonIn / jsonIn,jsonBase: ',jsonIn, jsonBase))

pyIn = system.util.jsonDecode(jsonIn)
pyBase = system.util.jsonDecode(jsonBase)

#system.perspective.print(('setByJsonIn / pyIn,pyBase: ',pyIn,pyBase))

if not isinstance(pyIn,dict):
	return

wherePlus = pyIn.get('wherePlus', None)
if 'prepQuery' in pyBase:

	# Return if "wherePlus": None or "wherePlus" doesn't exist inside in jsonIn. 
	# Special case for query with no parameters is to set "wherePlus":[]
	if wherePlus is None:
		return

	args = [x['arg'] for x in pyIn['wherePlus']]

	query = (pyBase['prepQuery']).get('query', None)

	if isinstance(query, str):
		drp = self.getChild("Dropdown")

		# If args[0] (usually it is id column in db table) is not positive integer avoid query execution, list of option is None
		if isinstance(args,list) and len(args) == 1 and args[0] <= 0:
			drp.props.options = None
		else:
			drp.props.options = system.db.runPrepQuery(query,args,'HMSOps') 

		drp.props.value = -1

